import React from "react";
import styled from "styled-components";

const Container = styled.div``;

const SerchTop = styled.div`
  display: flex;
`;

const Issue = () => {
  return (
    <Container>
      <SerchTop></SerchTop>
    </Container>
  );
};

export default Issue;
